webpackJsonp([0xb364ece05791],{2613:function(n,e){n.exports={data:{markdownRemark:{html:'<h2>Functional overview</h2>\n<p>Hi-macho (Hi macho) is an encounter bulletin board CGI for EZweb that inspired from EZweb\'s official encounter board "Hiraguchu (provided by Family Biz Co., Ltd.)". It works in Perl 5.005 or later and is functional, easy to use, and muscular.</p>\n<h2>Characteristic</h2>\n<p><img src="https://danmaq.com/wp-content/uploads/2013/11/macho.gif"></p>\n<ul>\n<li>\n<p>A simple and easy-to-use bulletin board function bulletin board is divided into five threads and you can change the writing place depending on the mood of the day.</p>\n</li>\n<li>\n<p>Macho mail function One user is given Himaccho private PO Box "Macho Mail". Here you can send and receive fulfillment letters to other muscular associates.</p>\n</li>\n<li>\n<p>Macho mail notification function A fulfillment notice when you do not know when the reply will come. A kind function that will notify you by e-mail without having to access each time.</p>\n</li>\n<li>\n<p>Friends registration function Fellows who made a great effort are no better than strangers unless there is contact means. Register here if you become friends! You can send a letter of appeal at any time!</p>\n</li>\n<li>\n<p>Friend search function That shy daughter will not miss! People who do not write on bulletin boards also capture one shot with this search function. Final weapon of muscle fellow proliferation function!</p>\n</li>\n<li>\n<p>Junk user quarantine function Even such a weak fellow! Let\'s cut off the edge with such a person by using this isolation function quickly. Just use too much will cause troubles around you ....</p>\n<h2>Other</h2>\n</li>\n<li>\n<p>Service period: 2001/3 ~ 2002/12</p>\n</li>\n<li>\n<p>Distribution of CGI continues until 2009 until then.</p>\n<h2>Distribution of this script has ended.</h2>\n</li>\n</ul>',frontmatter:{cover:null,date:"2001-03-01T00:00:00+09:00",strDate:"2001/2/28",title:"Hi-macho - Dating bulletin board system for EZweb"}}},pathContext:{path:"/en/blog/2001/03/01-hi-macho/",langKey:"en"}}}});
